    <ul className="bg-info p-5 m-5 rounded">{jok.map(x => {
        <>
    <li key={x.id}>
    <div>{x.image}</div>
    <div>
    <span>{x.name}</span>
    <span>{x.year}</span>
    </div>
    </li> 
</>
 })}  
   <button className="btn bg-primary m-5">Clear All</button>

    </ul>
  )
}
